const ExpencesIteam = (props) => {
  return (
    <li id={props.keys}>
      <div>
        <Dates date={props.date} />
      </div>
      <div>
        <h2>{props.title}</h2>
      </div>

      <div>{props.amount}</div>
    </li>
  );
};
export default ExpencesIteam;
